  {text : 'jugar' , estador : false}
]

function App() {
  return (
    <React.Fragment>
      <TodoCounter />
      <h2>Has Compleyado 1 tarea </h2>

      <TodoSearch/>
      <input placeholder="escribe tu tarea"/>

      <TodoList>
        {todoTarea.map(item =>
        <todoItem/>)
        }
      </TodoList>

      <CreateButton></CreateButton>
      <button>++</button>

    </React.Fragment>
  )
}

export default App;
